import styled from "styled-components";

export const FriendItem = styled.li`
  display: block;
  width: 200px;
  height: 50px;

  box-shadow: 0px 2px 4px white;
`;

export const Indicator = styled.span`
  width: 20px;
  height: 20px;
  border-radius: 50%;

  background-color: red;
`;
